import { engLetters } from "../models/Regex";
import { GrayButton } from "../styles/Buttons";
import { LoginBox, MainMenuBox, MenuButton } from "../styles/Menu";
import { SerifText } from "../styles/TextStyles";
import { MenuButtonY } from "./buttons/MenuButtonsY";
import { InputBase } from "./Input";

export const MenuHidden = ({ isOpen }: any) => {
  return (
    <MainMenuBox theme={isOpen}>
      <MenuButtonY img={"orderHistory"} label={"My orders"} />
      <MenuButtonY img={"myLists"} label={"My lists"} />
      <MenuButtonY img={"orderHistory"} label={"Dark mode"} />
      <LoginBox>
        <SerifText>Login</SerifText>
        {/* <Input placeholder={"Loigin"} type={"login"}></Input> */}
        <SerifText>Password</SerifText>
        {/* <Input placeholder={"Password"} type={"password"}></Input> */}
        <GrayButton onClick={() => console.log("x")}>
          <ButtonText>Login</ButtonText>
        </GrayButton>
      </LoginBox>
      {/* <MenuButtonY img={"logout"} label={"logout"} /> */}
    </MainMenuBox>
  );
};
